INSERT INTO `jos_jfbconnect_config` (`id`, `setting`, `value`, `created_at`, `updated_at`) VALUES (26,'autotune_field_descriptors','O:8:\"stdClass\":2:{s:7:\"version\";s:3:\"4.1\";s:5:\"group\";a:6:{i:0;O:8:\"stdClass\":4:{s:4:\"name\";s:11:\"Application\";s:11:\"description\";s:45:\"Basic settings for your Facebook Application.\";s:5:\"field\";a:6:{i:0;O:8:\"stdClass\":4:{s:4:\"name\";s:2:\"id\";s:7:\"display\";s:6:\"App ID\";s:11:\"description\";s:47:\"The unique Application ID provided by Facebook.\";s:4:\"type\";s:4:\"text\";}i:1;O:8:\"stdClass\":4:{s:4:\"name\";s:4:\"name\";s:7:\"display\";s:8:\"App Name\";s:11:\"description\";s:29:\"The name of your Application.\";s:4:\"type\";s:4:\"text\";}i:2;O:8:\"stdClass\":7:{s:4:\"name\";s:11:\"app_domains\";s:7:\"display\";s:7:\"Domains\";s:11:\"description\";s:171:\"The base domain of your site. Any subdomains from this setting will work with Facebook\n                Authentication. Generally, this should not include www.\n            \";s:9:\"recommend\";s:19:\"mycodelicforest.org\";s:5:\"match\";s:5:\"exact\";s:4:\"type\";s:5:\"array\";s:4:\"edit\";s:4:\"true\";}i:3;O:8:\"stdClass\":8:{s:4:\"name\";s:11:\"website_url\";s:7:\"display\";s:8:\"Site URL\";s:11:\"description\";s:40:\"Should be the homepage URL of your site.\";s:9:\"recommend\";s:27:\"http://mycodelicforest.org/\";s:5:\"match\";s:5:\"exact\";s:4:\"type\";s:3:\"url\";s:4:\"edit\";s:4:\"true\";s:8:\"required\";s:4:\"true\";}i:4;O:8:\"stdClass\":6:{s:4:\"name\";s:9:\"namespace\";s:7:\"display\";s:9:\"Namespace\";s:11:\"description\";s:264:\"This value is used by Open Graph tags and Actions as well as your Canvas area, if enabled.\n                <br/>It must use only lower case letters, dashes or underscores. It is not recommended to change your Namespace once your site is in production.\n            \";s:5:\"match\";s:8:\"notblank\";s:4:\"type\";s:4:\"text\";s:4:\"edit\";s:4:\"true\";}i:5;O:8:\"stdClass\":6:{s:4:\"name\";s:19:\"server_ip_whitelist\";s:7:\"display\";s:19:\"Server IP Whitelist\";s:11:\"description\";s:157:\"IP addresses that are specifically allowed to access your application/website. This should\n                always be blank for normal operation.\n            \";s:4:\"type\";s:3:\"url\";s:5:\"match\";s:5:\"blank\";s:4:\"edit\";s:4:\"true\";}}s:7:\"comment\";a:2:{i:0;O:8:\"stdClass\":0:{}i:1;O:8:\"stdClass\":0:{}}}i:1;O:8:\"stdClass\":4:{s:4:\"name\";s:13:\"Website Links\";s:11:\"description\";s:126:\"Information about your Website and how users can get help if they run into issues using your\n            application.\n        \";s:7:\"comment\";O:8:\"stdClass\":0:{}s:5:\"field\";a:6:{i:0;O:8:\"stdClass\":6:{s:4:\"name\";s:18:\"privacy_policy_url\";s:7:\"display\";s:18:\"Privacy Policy URL\";s:11:\"description\";s:193:\"The full URL to a privacy policy on your site. JFBConnect will function with this value blank,\n                but Facebook states that they require a Privacy Policy URL to be set.\n            \";s:4:\"type\";s:3:\"url\";s:5:\"match\";s:8:\"notblank\";s:4:\"edit\";s:4:\"true\";}i:1;O:8:\"stdClass\":6:{s:4:\"name\";s:18:\"user_support_email\";s:7:\"display\";s:18:\"User Support Email\";s:11:\"description\";s:154:\"The email address for users to contact you for issues with your application. Facebook states\n                that this is a required setting.\n            \";s:4:\"type\";s:4:\"text\";s:5:\"match\";s:8:\"notblank\";s:4:\"edit\";s:4:\"true\";}i:2;O:8:\"stdClass\":6:{s:4:\"name\";s:13:\"contact_email\";s:7:\"display\";s:13:\"Contact Email\";s:11:\"description\";s:162:\"Email address that Facebook can contact you at if there is important information regarding your\n                application. This is not made public.\n            \";s:4:\"type\";s:4:\"text\";s:5:\"match\";s:8:\"notblank\";s:4:\"edit\";s:4:\"true\";}i:3;O:8:\"stdClass\":5:{s:4:\"name\";s:16:\"user_support_url\";s:7:\"display\";s:16:\"User Support URL\";s:11:\"description\";s:62:\"Optional URL that user\'s can visit for support related issues.\";s:4:\"type\";s:3:\"url\";s:4:\"edit\";s:4:\"true\";}i:4;O:8:\"stdClass\":5:{s:4:\"name\";s:20:\"terms_of_service_url\";s:7:\"display\";s:20:\"Terms of Service URL\";s:11:\"description\";s:66:\"Optional URL which contains the Terms of Service for your website.\";s:4:\"type\";s:3:\"url\";s:4:\"edit\";s:4:\"true\";}i:5;O:8:\"stdClass\":6:{s:4:\"name\";s:19:\"deauth_callback_url\";s:7:\"display\";s:29:\"De-Authorization Callback URL\";s:11:\"description\";s:261:\"This URL is \'pinged\' by Facebook when a user de-authorizes your Application. JFBConnect will\n                mark the user as \'Not Authorized\' in the User Map area so that you can be aware of users who have\n                removed your application.\n            \";s:4:\"type\";s:3:\"url\";s:9:\"recommend\";s:79:\"http://mycodelicforest.org/index.php?option=com_jfbconnect&task=deauthorizeUser\";s:5:\"match\";s:5:\"exact\";}}}i:2;O:8:\"stdClass\":4:{s:4:\"name\";s:12:\"Presentation\";s:11:\"description\";s:153:\"These options control how the Permissions Request (login) popup will look as well as how your app/website is found within Facebook\'s App Center.\n        \";s:5:\"field\";a:8:{i:0;O:8:\"stdClass\":5:{s:4:\"name\";s:20:\"auth_dialog_headline\";s:7:\"display\";s:8:\"Headline\";s:11:\"description\";s:142:\"The title for your website, shown in the main authentication popup when a user logs into your\n                site with Facebook.\n            \";s:4:\"type\";s:4:\"text\";s:4:\"edit\";s:4:\"true\";}i:1;O:8:\"stdClass\":5:{s:4:\"name\";s:11:\"description\";s:7:\"display\";s:11:\"Description\";s:11:\"description\";s:147:\"The description for your website, shown in the main authentication popup when a user logs into\n                your site with Facebook\n            \";s:4:\"type\";s:4:\"text\";s:4:\"edit\";s:4:\"true\";}i:2;O:8:\"stdClass\":5:{s:4:\"name\";s:29:\"auth_dialog_perms_explanation\";s:7:\"display\";s:22:\"Permission Explanation\";s:11:\"description\";s:343:\"A description of why the authentication popup may request additional information about the user\n                in a 2nd popup. This happens when you have Profile Plugins enabled and are importing extended user\n                information or are requesting to the Post To Wall permission for registration or login automated posts.\n            \";s:4:\"type\";s:4:\"text\";s:4:\"edit\";s:4:\"true\";}i:3;O:8:\"stdClass\":7:{s:4:\"name\";s:16:\"social_discovery\";s:7:\"display\";s:16:\"Social Discovery\";s:11:\"description\";s:106:\"Determines whether app usage stories will appear in the news feed, i.e. User is using AppName\n            \";s:4:\"type\";s:4:\"bool\";s:4:\"edit\";s:4:\"true\";s:9:\"recommend\";s:4:\"true\";s:5:\"match\";s:5:\"exact\";}i:4;O:8:\"stdClass\":4:{s:4:\"name\";s:4:\"info\";s:7:\"display\";s:23:\"Developer Area Settings\";s:11:\"description\";s:69:\"The settings below can only be updated in the Facebook Developer Area\";s:4:\"type\";s:4:\"info\";}i:5;O:8:\"stdClass\":4:{s:4:\"name\";s:8:\"logo_url\";s:7:\"display\";s:8:\"App Logo\";s:11:\"description\";s:168:\"The logo for your website/application. This is shown on the Authentication popup. This logo can\n                only be set in the Facebook Developer area.\n            \";s:4:\"type\";s:5:\"image\";}i:6;O:8:\"stdClass\":4:{s:4:\"name\";s:8:\"icon_url\";s:7:\"display\";s:8:\"App Icon\";s:11:\"description\";s:209:\"The icon for your website/application. This is shown in various locations on Facebook when your\n                application is referenced. This icon can only be set in the Facebook Developer area.\n            \";s:4:\"type\";s:5:\"image\";}i:7;O:8:\"stdClass\":4:{s:4:\"name\";s:8:\"category\";s:7:\"display\";s:8:\"Category\";s:11:\"description\";s:194:\"Category of your application. Used for user searches on Facebook for applications of a specific\n                type. The category can only be set from the Facebook Developers page.\n            \";s:4:\"type\";s:4:\"text\";}}s:7:\"comment\";a:4:{i:0;O:8:\"stdClass\":0:{}i:1;O:8:\"stdClass\":0:{}i:2;O:8:\"stdClass\":0:{}i:3;O:8:\"stdClass\":0:{}}}i:3;O:8:\"stdClass\":3:{s:4:\"name\";s:6:\"Canvas\";s:11:\"description\";s:236:\"Canvas settings describe what page from your site should be seen when viewing your application on\n            apps.facebook.com.\n            <br/>A properly configured Canvas is also required to properly send Facebook Requests.\n        \";s:5:\"field\";a:4:{i:0;O:8:\"stdClass\":7:{s:4:\"name\";s:10:\"canvas_url\";s:7:\"display\";s:10:\"Canvas URL\";s:11:\"description\";s:175:\"The URL of the page that will load from your site when viewed within Facebook. This can be your\n                home page or another interior page from your site.\n            \";s:4:\"type\";s:3:\"url\";s:9:\"recommend\";s:27:\"http://mycodelicforest.org/\";s:5:\"match\";s:11:\"starts_with\";s:4:\"edit\";s:4:\"true\";}i:1;O:8:\"stdClass\":7:{s:4:\"name\";s:17:\"secure_canvas_url\";s:7:\"display\";s:17:\"Secure Canvas URL\";s:4:\"type\";s:3:\"url\";s:11:\"description\";s:190:\"The secure (https) URL of the page that will load from your site when viewed within Facebook.\n                This can be your home page or another interior page from your site.\n            \";s:9:\"recommend\";s:28:\"https://mycodelicforest.org/\";s:5:\"match\";s:11:\"starts_with\";s:4:\"edit\";s:4:\"true\";}i:2;O:8:\"stdClass\":7:{s:4:\"name\";s:19:\"canvas_fluid_height\";s:7:\"display\";s:19:\"Canvas Fluid Height\";s:11:\"description\";s:141:\"Enable this to let JFBConnect automatically set the height of your page as necessary when\n                viewed on Facebook.com\n            \";s:4:\"type\";s:4:\"bool\";s:9:\"recommend\";s:4:\"true\";s:5:\"match\";s:5:\"exact\";s:4:\"edit\";s:4:\"true\";}i:3;O:8:\"stdClass\":7:{s:4:\"name\";s:18:\"canvas_fluid_width\";s:7:\"display\";s:18:\"Canvas Fluid Width\";s:11:\"description\";s:131:\"Disabling this will confine your Canvas area to a width of 760px. Enable to use the full screen\n                width.\n            \";s:4:\"type\";s:4:\"bool\";s:9:\"recommend\";s:4:\"true\";s:5:\"match\";s:5:\"exact\";s:4:\"edit\";s:4:\"true\";}}}i:4;O:8:\"stdClass\":4:{s:4:\"name\";s:8:\"Page Tab\";s:11:\"description\";s:70:\"A Page Tab lets you show your site within your Facebook Page.\n        \";s:5:\"field\";a:3:{i:0;O:8:\"stdClass\":7:{s:4:\"name\";s:21:\"page_tab_default_name\";s:7:\"display\";s:21:\"Page Tab Default Name\";s:11:\"description\";s:101:\"The name of the Page Tab that user\'s will see (configurable after being added to a Page)\n            \";s:4:\"type\";s:4:\"text\";s:9:\"recommend\";s:10:\"JFBConnect\";s:5:\"match\";s:8:\"notblank\";s:4:\"edit\";s:4:\"true\";}i:1;O:8:\"stdClass\":7:{s:4:\"name\";s:12:\"page_tab_url\";s:7:\"display\";s:12:\"Page Tab URL\";s:11:\"description\";s:200:\"The URL of the page that will load from your site when viewed within the Facebook Page. This\n                can be your\n                home page or another interior page from your site.\n            \";s:4:\"type\";s:3:\"url\";s:9:\"recommend\";s:27:\"http://mycodelicforest.org/\";s:5:\"match\";s:11:\"starts_with\";s:4:\"edit\";s:4:\"true\";}i:2;O:8:\"stdClass\":7:{s:4:\"name\";s:19:\"secure_page_tab_url\";s:7:\"display\";s:19:\"Secure Page Tab URL\";s:11:\"description\";s:215:\"The secure (https) URL of the page that will load from your site when viewed within the\n                Facebook Page. This can be your\n                home page or another interior page from your site.\n            \";s:4:\"type\";s:3:\"url\";s:9:\"recommend\";s:28:\"https://mycodelicforest.org/\";s:5:\"match\";s:11:\"starts_with\";s:4:\"edit\";s:4:\"true\";}}s:7:\"comment\";O:8:\"stdClass\":0:{}}i:5;O:8:\"stdClass\":3:{s:4:\"name\";s:10:\"Migrations\";s:11:\"description\";s:365:\"Migrations are settings from Facebook that let you enable or disable features before they become\n            mandatory. JFBConnect will automatically set the required migration settings for your application when you\n            save data. If you need to manually change these settings, you must do it from Facebook\'s Application\n            Developer area.\n        \";s:5:\"field\";a:4:{i:0;O:8:\"stdClass\":6:{s:4:\"name\";s:7:\"q4_2013\";s:7:\"display\";s:29:\"October 2013 Breaking Changes\";s:11:\"description\";s:268:\"Multiple changes regarding Facebook API. JFBConnect is already up-to-date in all areas. One benefit of this migration is that the Send button will now\n                always use Open Graph tags for it\'s display in the Feed, which is a very welcome update.\n            \";s:9:\"recommend\";s:1:\"1\";s:5:\"match\";s:5:\"exact\";s:4:\"type\";s:4:\"bool\";}i:1;O:8:\"stdClass\":6:{s:4:\"name\";s:18:\"secure_stream_urls\";s:7:\"display\";s:24:\"Stream Post URL Security\";s:11:\"description\";s:202:\"When enabled, all posts to a user\'s wall must be to either your Canvas or website URL. Leaving\n                this disabled offers more flexibility for the posts your application can make.\n            \";s:9:\"recommend\";s:1:\"0\";s:5:\"match\";s:5:\"exact\";s:4:\"type\";s:4:\"bool\";}i:2;O:8:\"stdClass\":6:{s:4:\"name\";s:15:\"recent_activity\";s:7:\"display\";s:31:\"Include Recent Activity Stories\";s:11:\"description\";s:57:\"Allows accessing more information from a user\'s timeline.\";s:9:\"recommend\";s:1:\"1\";s:5:\"match\";s:5:\"exact\";s:4:\"type\";s:4:\"bool\";}i:3;O:8:\"stdClass\":6:{s:4:\"name\";s:15:\"events_timezone\";s:7:\"display\";s:15:\"Events Timezone\";s:11:\"description\";s:140:\"Change Event start and end times to use Timezones. Change does not affect built-in Facebook functionality, but is recommended for all users.\";s:9:\"recommend\";s:1:\"1\";s:5:\"match\";s:5:\"exact\";s:4:\"type\";s:4:\"bool\";}}}}}','2017-02-19 05:41:16','2017-02-19 05:41:16');
